import React from 'react';
import { useGlobalStates } from './utils/global.context'


const Footer = () => {
	const { theme } = useGlobalStates();
  return (
    <footer className={theme}>
      <div className='logos'>
        <p>Powered by</p>
        <p>Mercedes Bakker - CAMADA 4 all rights reserved</p>
        <img src="./images/DH.png" alt='DH-logo' width="100%"/>
          <ul>
            <li><img src=".Components/images/ico-facebook.png" alt='facebook'/></li>
            <li><img src=".Components/images/ico-instagram.png" alt='instagram'/></li>
            <li><img src=".Components/images/ico-tiktok.png" alt='tiktok'/></li>
            <li><img src=".Components/images/ico-whatsapp.png" alt='whatsapp'/></li>
          </ul>
      </div>
    </footer>
  )
}

export default Footer;
